    'Article 9 -  Intellectual property' => 'Article 9 -  Propriété intellectuelle',
    'Article 10 -  Complaints procedure and disputes' => 'Article 10 -  Règlement en matière de réclamations et litiges',
    'Our Terms and Conditions apply to all offers by us as Online Retailer, 
                                to you as Consumer (any natural person who, for non-professional purposes only, acquires or uses products or services on the market)' => 'Les présentes conditions générales s\'appliquent à chaque offre/proposition entre AfamiaShop en tant que webshop et vous en tant que Consommateur (toute personne physique qui acquiert ou utilise, à des fins excluant tout professionnel, des produits ou des services mis sur le marché)',
    'We only deliver in Belgium. If you select a shipping address in a different country, we can refuse your order' => 'Nous ne livrons qu\'en Belgique. Si votre adresse de livraison se situe dans un autre pays, nous nous réservons le droit de refuser votre commande.',
    'You need to be at least 18 years of age to place an order. If you\'re not 18 yet, we\'d like to ask you to have your parents or a legal guardian place the order. 
                                If we notice that an order has been placed by a minor, we can refuse this order' => 'Pour placer une commande, vous devez être âgé d\'au moins 18 ans. Si vous n\'avez pas encore 18 ans, nous demandons que vos parents ou un tuteur légal placent la commande. Si nous remarquons qu\'une commande a été placée par un mineur, nous sommes en droit de refuser cette commande',
    'Placing an order on the website counts as explicit acceptance of our Terms and Conditions, which can be accessed at all times through our website' => 'En plaçant une commande sur notre site, vous acceptez explicitement nos conditions générales qui sont disponibles sur notre site web à tout moment',
    'If you order online, we will attach a copy of these Terms and Conditions in a format that can be saved or printed to your order confirmation or, at the latest, to your delivery. 
                                We urge you to always save or print the Terms and Conditions' => 'Si vous commandez en ligne, une copie de ces conditions générales vous sera fournie lors de la confirmation de votre commande ou au plus tard lors de la livraison, sous un format que vous pouvez enregistrer ou imprimer, ce que nous vous recommandons de faire dans tous les cas',
    'In the event that, in addition to these general Terms and Conditions, specific product or service conditions also apply, the above also applies to those special conditions. In the event of conflicting conditions, 
                                the consumer can always invoke the applicable condition that is most favorable to them' => 'Dans l\'hypothèse où, outre les présentes conditions générales, des conditions spécifiques aux produits ou aux services sont d\'application, ce qui précède s\'applique également à ces conditions particulières. En cas de dispositions contradictoires entre les conditions, le consommateur peut toujours invoquer l\'application de la disposition lui étant la plus favorable',
    'If an offer has a limited validity period, or is made under conditions, this will be explicitly stated in the offer' => 'Lorsqu\'une offre a une durée de validité limitée ou est soumise à conditions, ceci est toujours mentionné expressément dans l\'offre',
    'We\'ll describe what we sell and how the order process will proceed as fully and accurately as possible. The description will 
                                be sufficiently detailed to enable a good evaluation of the offer by the consumer. If we use images, these will be a true representation 
                                of the offered products, digital content, and/or services. Oversights happen, and if we\'ve clearly made a mistake, we\'re not 
                                required to deliver afterwards' => 'Notre offre contient toujours une description complète et précise des produits proposés et de la méthode de commande. La description est suffisamment détaillée pour vous permettre d\'évaluer adéquatement le contenu de l\'offre. Si AfamiaShop a recours à des images/photos, celles-ci sont une représentation fidèle des produits et/ou services proposés. Cependant, l\'erreur est humaine et dans le cas où nous nous sommes manifestement trompés, nous ne nous trouvons pas dans l\'obligation de quand même vous livrer les produits demandés',
    'If you order from us, you\'ll receive a confirmation by email. Your order will be complete and the agreement between us will be definitive 
                                as soon as we\'ve received approval from the card company for your transaction with debit or credit cards. We accept Bancontact, Paypal, Visa, 
                                MasterCard, money transfers, and cash. If the card company does not approve of your payment to us, we cannot be held responsible for delays in 
                                shipping and/or non-delivery of your order. Orders without a valid payment in the name of the registered cardholder will not be accepted or processed' => 'Votre commande est complète et l\'accord entre nous définitif dès que nous avons confirmé votre commande par mail et dès que nous avons reçu la validation de votre transaction financière avec une carte de crédit ou de débit par l\'organisme émetteur de cette carte. Nous acceptons les paiements par Visa, MasterCard, et les paiements en espèces ainsi que par carte de paiement dans un des magasins AfamiaShop. Dans le cas où l\'organisme émetteur de votre carte refuse votre paiement à destination de AfamiaShop, nous ne pouvons pas être tenus responsables des retards et/ou de la non-livraison de votre commande. Les commandes sans paiement valide au nom du titulaire enregistré de la carte ne seront pas acceptées ou traitées',
    'To purchase a product, you add the product to your shopping cart. Afterwards, you provide your contact information and invoice information. Next, you 
                                choose your delivery method: delivery on your chosen address, send to a chosen pickup point, or pickup in one of our AfamiaShop store. During the last step, you\'ll 
                                see an overview page where you can accept our Terms and Conditions and where you can confirm the payment by clicking the order button ¿I\'m going to order¿. 
                                Once you\'ve completed these steps, your purchase is final' => 'Pour acheter un produit, ajoutez-le à votre panier. Ensuite, remplissez le formulaire avec vos données personnelles ainsi que vos données de facturation et choisissez votre mode de livraison : livraison à l\'adresse choisie, retrait au point de retrait de votre choix ou retrait dans un de nos magasins AfamiaShop. Dans la dernière étape du procédé de commande, vous verrez une page de résumé où il vous sera demandé d\'accepter nos Conditions Générales et de confirmer votre paiement par l\'activation du bouton « Je commande ». Si vous avez parcouru toutes ces étapes, votre achat est définitif',
    'During the period we mention in our offer, our prices do not change, with the exception of price changes due to changes in VAT rates' => 'Pendant la durée de validité mentionnée dans l\'offre, les prix des produits et/ou services proposés ne seront pas augmentés, sauf les modifications de prix résultant d\'une évolution des taux de TVA',
    'Our prices include all taxes, VAT, taxes and services. You will never face surprises here. Shipping is free. If you choose time slot delivery 
                                we will charge shipping costs. In that case, we always let you know before you place your order' => 'Nos prix incluent l\'ensemble des taxes, impôts et services. Il n\'y aura donc jamais de surprise pour vous. La livraison est gratuite. Cependant, si vous choisissez l\'option de livraison LivréAujourd\'hui® ou la livraison sur rendez-vous dans le créneau horaire de votre choix, les frais d\'envoi seront à votre charge. Dans ce cas, nous vous en notifierons avant la confirmation de votre commande',
    'If you order from us, you\'ll receive a confirmation by email. Your order will be complete and the agreement between us will be definitive 
                                as soon as we\'ve received approval from the card company for your transaction with debit or credit cards. We accept Visa, 
                                MasterCard and cash. If the card company does not approve of your payment to us, we cannot be held responsible for delays in 
                                shipping and/or non-delivery of your order. Orders without a valid payment in the name of the registered cardholder will not be accepted or processed' => 'Votre commande est complète et l\'accord entre nous définitif dès que nous avons confirmé votre commande par mail et dès que nous avons reçu la validation de votre transaction financière avec une carte de crédit ou de débit par l\'organisme émetteur de cette carte. Nous acceptons les paiements par Visa, MasterCard et les paiements en espèces ainsi que par carte de paiement dans un des magasins AfamiaShop. Dans le cas où l\'organisme émetteur de votre carte refuse votre paiement à destination de AfamiaShop, nous ne pouvons pas être tenus responsables des retards et/ou de la non-livraison de votre commande. Les commandes sans paiement valide au nom du titulaire enregistré de la carte ne seront pas acceptées ou traitées',
    'We can only accept payment via the payment modules on our website for online orders' => 'Pour les commandes placées en ligne, le paiement est limité aux modes de paiement proposés sur notre site internet',
    'In order to guarantee secure online payments and the security of your personal data, 
                                the transaction data is transmitted via the internet, encrypted with SSL technology. To pay with SSL, 
                                you do not need special software. You can recognize a secure SSL connection by the "lock" in your browser\'s status bar' => 'Afin de garantir un paiement en ligne sécurisé ainsi que la confidentialité de vos données à caractère personnel, les données de transaction seront cryptées avec une technologie SSL et envoyées sur internet. Vous n\'avez pas besoin de logiciel spécial pour faire des transactions avec SSL. Vous reconnaitrez une connexion sécurisée SSL au petit cadenas dans la barre de recherche de votre navigateur',
    'We guarantee that our goods are in accordance with your order and meet the normal expectations that you may have, taking into account 
                                the specifications of the product. We also guarantee that our goods comply with all laws existing at the time of your order.' => 'Nous garantissons que nos produits sont conformes à votre commande et répondent aux attentes normales que vous pouvez avoir tenant compte des spécifications du produit. Évidemment, nous garantissons également que nos biens répondent à l\'ensemble des lois existantes au moment de votre commande.',
    'In addition, with regard to the delivery of goods, we also apply the statutory minimum warranty period of two years if the good is 
                                not in conformity with the order placed. This means that, in case of defects or defects to the good, this good will be repaired free of 
                                charge or replaced for up to 2 years after delivery.' => 'En outre, concernant la livraison de biens, vous jouissez du délai de garantie légale minimum de deux ans en cas de non-conformité du bien de consommation. Ceci signifie qu\'en cas de défaut ou de vice du bien, vous avez le droit à la réparation ou au remplacement sans frais du bien, et ce jusque 2 ans après la livraison.',
    'Sometimes AfamiaShop or its supplier offers a longer or more extensive warranty than the legal minimum warranty of 2 years; this is a 
                                commercial warranty. The commercial warranty does not affect the statutory minimum warranty. Whether a commercial warranty is offered differs per product. 
                                The characteristics of the commercial warranty are stated on the product web page and the proof of warranty. AfamiaShop is responsible for handling the commercial warranty, 
                                unless stated otherwise on the product\'s web page. Commercial warranties apply in Belgium and for the period stated on the product\'s web page.' => 'Il arrive que AfamiaShop ou ses fournisseurs proposent une garantie plus longue ou plus étendue que la garantie légale minimum : c\'est la garantie commerciale. La garantie commerciale ne réduit pas la garantie minimum légale. Dans le cas d\'une garantie commerciale, celle-ci varie en fonction du produit. Les caractéristiques de la garantie commerciale sont mentionnées sur la page internet du produit ainsi que sur la preuve de garantie. AfamiaShop se tient responsable du traitement de la garantie commerciale, sauf indication contraire sur la page internet du produit. Les garanties commerciales sont valables en Belgique et durant le délai indiqué sur la page internet du produit.',
    'All goods and services are delivered on the address you supplied in your order' => 'Les livraisons de produits et services prennent place à l\'adresse de livraison communiquée lors de votre commande',
    'We will take the greatest possible care when receiving and implementing product orders, 
                                and when assessing applications for the provision of services' => 'Nous ferons preuve de la plus grande diligence possible lors de la réception des commandes de produits et lors de l\'exécution de celles-ci et à l\'occasion de l\'appréciation des demandes de fourniture de services',
    'We will execute accepted orders expeditiously but no later than 30 days, unless another delivery period has been agreed upon. If the delivery
                                is delayed, or if an order cannot or only partially be executed, we will always inform you before the expiration of the planned delivery period. If we 
                                do not, you can cancel your order, free of charge. In that case, we will refund you within 30 days after termination' => 'Nous exécutons les commandes acceptées dans les meilleurs délais et, en toutes circonstances, dans les 30 jours, à moins qu\'un autre délai de livraison n\'ait été convenu. Dans le cas où la livraison subit un retard ou lorsqu\'une commande ne peut être exécutée, même partiellement, nous vous en informons toujours avant la fin du délai de livraison prévu. Si nous ne vous informons pas à temps, vous avez le droit d\'annuler votre commande sans frais. Dans ce cas, nous vous rembourserons dans les 30 jours suivant l\'annulation',
    'Our shipments are always at our risk until the time of delivery to you or a representative appointed by you. You do not have to worry about goods 
                                that are lost in the mail. However, if you return us goods within 30 days of purchase because you would rather not keep them, you 
                                are responsible for transportation.' => 'Jusqu\'au moment de réception de la commande par vous ou un représentant désigné préalablement, les envois ont toujours lieu à notre risque. Vous ne devrez jamais vous soucier d\'éventuelles pertes de marchandises dans la poste. Cependant, l\'envoi de retour de marchandises que vous nous retournez dans les 30 jours suivant l\'achat parce que vous ne souhaitez pas les conserver, a toujours lieu à votre propre risque.',
    'If the goods delivered by us during the transport were damaged, do not correspond with the items stated on the delivery note, or do not correspond to the 
                                items you ordered, you must report this as soon as possible and return the items to us' => 'Si les marchandises livrées par nos soins ont été endommagées pendant le transport, ne correspondent pas aux articles figurant sur le bon de livraison ou ne correspondent pas aux articles que vous avez commandés, vous devez le signaler le plus tôt possible et nous renvoyer les articles en question',
    'We can not be held responsible for any consequential damages due to late delivery or non-delivery by the carrier that the company has appointed. Our liability 
                                in such cases is limited to the value of the items that are shown not to have been received by the customer' => 'Nous ne pouvons être tenus responsables de tout dommage indirect à la suite d\'une livraison tardive ou d\'une non-livraison par le transporteur désigné par l\'entreprise. Dans ces cas-là, notre responsabilité se limite à la valeur des biens dont il peut être démontré qu\'ils n\'ont pas été reçus par le client',
    'In the event of force majeure, we are not required to carry out our obligations. In the case of force majeure, we can either postpone our 
                                obligations for the duration of the force majeure, or terminate the agreement permanently.' => 'En cas de force majeure, nous ne sommes pas tenus de respecter nos obligations. Dans ce cas, nous nous réservons le droit de suspendre nos obligations pour la durée de la force majeure ou d\'annuler définitivement votre commande.',
    'Force majeure includes any situation outside of our will and control which prevents us from fulfilling our promises to you. This includes strikes, 
                                fire, malfunctions, power failures, network failures in, for instance, telecommunication networks, connections, or used systems of communication, or the unavailability of our website at any time, non-timely delivery by suppliers or other third parties' => 'On entend par force majeure toute circonstance indépendante de notre volonté et de notre contrôle qui empêche entièrement ou partiellement le respect de nos obligations à votre égard. Ces circonstances sont entre autres : les grèves, les incendies, le chômage technique, les pannes de courant, les perturbations dans un réseau (de télécommunication) ou dans la connexion ou les systèmes de communication utilisés et/ou la non disponibilité de notre site internet à un moment donné, l\'absence de livraison ou la livraison tardive par nos sous-traitants ou d\'autres tiers concernés',
    'Our website, logos, texts, photos, names, and all our communication in general are protected by intellectual property rights known to us, or to our suppliers or other beneficiaries.' => 'Notre site web, nos logos, textes, photos, noms et en général toute notre communication, sont protégés par des droits d\'auteur appartenant soit à nous, soit à nos sous-traitants ou d\'autres ayants droits.',
    'It is prohibited to use and/or make changes to the intellectual property rights as described in this article. For example, you may not copy or reproduce drawings, photographs, texts, logos, 
                                color combinations, etc ... without our prior written consent.' => 'Il est interdit de faire usage de et/ou d\'apporter des modifications aux droits de propriété intellectuelle tels que décrits dans cet article. Par exemple, les dessins, photos, noms, textes, logos, combinaison de couleurs etc. ne peuvent en aucune manière être copiés ou reproduits sans autorisation expresse préalable et écrite de AfamiaShop.',
    'We hope that our customers are 100% satisfied. If you do have a complaint, please let us know as soon as possible via ay1665ay@gmail.com, phone number 0489 47 08 53, or via a letter 
                                addressed to: AfamiaShop Belgium , Rue des Rivageois 7 , 4000 Liège . We\'ll do everything we can to help you within 5 working days.' => 'Bien évidemment, nous espérons toujours que tous nos clients soient satisfaits à 100 %. Au cas où vous auriez néanmoins des plaintes sur la qualité de nos services, vous pouvez nous contacter via ay1665ay@AfamiaShop.be, par téléphone au 0489 47 08 53, ou par lettre adressée à : AfamiaShop Belgique , Rue des Rivageois 7 , 4000 Liège . Nous ferons tout notre possible pour traiter votre plainte dans les 5 jours ouvrables.',
    'All agreements that we conclude with our clients, regardless of their place of residence, are governed exclusively by Belgian law, and in case of a dispute, only the competent Belgian courts 
                                are competent. If, for reasons of international law, another law applies, Book VI of the Belgian Economic Law Code will be referenced when interpreting the current Terms and Conditions.' => 'Le droit belge est exclusivement d\'application sur tous les contrats avec nos clients, quel que soit leur lieu de résidence. Tous les litiges sont soumis à la compétence exclusive des cours et tribunaux belges. Si, pour des motifs de droit international, il s\'avérait malgré tout qu\'un autre droit s\'applique, il faudra dans un premier temps, à l\'occasion de l\'interprétation des conditions générales actuelles, se référer au Livre VI du Code de droit économique belge.',
    'The Consumer Mediation Service of the FOD Economie is qualified to process any request to settle extrajudicial consumer disputes. They will, in turn, process the request themselves or send it to a 
                                qualified entity. You can reach the Consumer Mediation Service via this link: https://www.consumentenombudsdienst.be/en' => 'En cas de règlement extrajudiciaire d\'un litige, le Service de Médiation pour le Consommateur mis en place par le Gouvernement fédéral est compétent pour recevoir toute demande de règlement extrajudiciaire de litiges avec des consommateurs. Celui-ci décidera alors de traiter lui-même la requête ou de la transmettre à une entité qualifiée. Vous pouvez contacter le Service de Médiation pour le Consommateur via le lien suivant : https://www.mediationconsommateur.be/fr',
    'If there is a cross-border dispute, the consumer can rely on the Online Dispute Resolution platform of the European Union via this link: https://ec.europa.eu/odr.' => 'En cas de litige ayant un caractère transfrontalier, le consommateur peut, en outre, recourir à la plateforme « Online Dispute Resolution » de l\'Union européenne par le biais du lien suivant : https://ec.europa.eu/odr.',
